import React, { useState, useEffect } from 'react';

const Dashboard: React.FC = () => {
  const [loading, setLoading] = useState(true);
  const [stats, setStats] = useState({
    totalCandidates: 0,
    activeJobs: 0,
    interviewsScheduled: 0,
    travelRequests: 0
  });

  useEffect(() => {
    setTimeout(() => {
      setStats({
        totalCandidates: 247,
        activeJobs: 12,
        interviewsScheduled: 8,
        travelRequests: 3
      });
      setLoading(false);
    }, 1000);
  }, []);

  if (loading) {
    return (
      <div className="loading">
        <div className="spinner"></div>
        <p>Loading dashboard...</p>
      </div>
    );
  }

  return (
    <div>
      <div className="stats-grid">
        <div className="stat-card">
          <div className="stat-number">{stats.totalCandidates}</div>
          <div className="stat-label">Total Candidates</div>
          <div className="stat-change">+12% from last month</div>
        </div>
        
        <div className="stat-card">
          <div className="stat-number">{stats.activeJobs}</div>
          <div className="stat-label">Active Jobs</div>
          <div className="stat-change">+5% from last month</div>
        </div>
        
        <div className="stat-card">
          <div className="stat-number">{stats.interviewsScheduled}</div>
          <div className="stat-label">Interviews Scheduled</div>
          <div className="stat-change">+23% from last month</div>
        </div>
        
        <div className="stat-card">
          <div className="stat-number">{stats.travelRequests}</div>
          <div className="stat-label">Travel Requests</div>
          <div className="stat-change">-8% from last month</div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
